import React from "react";

const Search = () => {

    let Search = "";

    const onChange = (evt) => {
        console.log(evt.target.value);
        Search = evt.target.value;

         
    }
    return (
        <div>
            <div>
                <input
                    placeholder="¿Qué pokemon quieres conocer?"
                    onChange={onChange}
                />
            </div>
        <div>
        {Search}
        </div>
        </div>
    )

};

export default Search;
